INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(152, 7, 4, 'Pack \"Cholestérol et Glycémie\"', 'Plusieurs plantes sont reconnues par l’Ayurvéda pour préserver le cœur et maintenir une cholestérolémie et une glycémie normales. Le Gymnema Sylvestris est connu pour diminuer l’envie d’aliments sucrés et faire baisser le taux de glucose dans le sang. Le Neem, en plus de son action détoxicante, aide à contrôler le taux de glucose. Associé au Gymnema Sylvestris, il participe au maintien d’une glycémie normale. Le Fenugrec ouvre et stimule l’appétit, tout en régulant le taux de sucre dans le sang. Pour combattre le mauvais cholestérol et purifier l’organisme, D.Y.Med propose le Guggul, titré à 2,5% de Guggulstérones, sa substance active.', 'Cible le mauvais cholestérol (LDL), élimine les graisses, diminue le taux de lipides dans le sang, élimines les toxines (intestins, sang et tissus),  équilibre le fonctionnement de la thyroïde, favorise la perte de poids', 'Extrait sec en poudre de Gymnenma Sylvestris, Extrait sec en poudre de Neem, Extrait sec en poudre de Fenugrec, Extrait sec en poudre de Guggul.', 'Utilisable dans un bain, ou même mélangé à de l\'eau en application cutanée, ou encore en complément alimentaire dans un jus de fruis.\n', 9, 'data:image/jpeg;base64,', NULL),
(153, 7, 4, 'Mélange \"Mémoire et Concentration\"', 'Difficultés d’apprentissage chez les plus jeunes, trous de mémoire en période de stress chez les adultes, ou petits oublis du quotidien chez les plus âgés :\r\nles troubles de la mémoire ou de la concentration peuvent survenir à tout âge.\r\nD.Y.Med vous propose de découvrir plusieurs plantes connues pour augmenter les capacités de concentration et de mémorisation :\r\nLe Brahmi, qui peut aussi bien être utilisé par les adultes que par les enfants ayant des difficultés de concentration;\r\nle Centella Indiana, particulièrement utile en période de stress ; et l’Amalaki, qui grâce à sa richesse en tanins prévient l’oxydation des cellules.\r\nCes trois plantes se retrouvent dans le Complexe mémoire, une préparation ayurvédique traditionnelle.', 'Anti-stress, Concentration facilitée, Anti-Oxydant, Aide à la mémoire sur long-terme.', 'Extrait sec en poudre de Gymnenma Sylvestris, Extrait sec en poudre de Neem, Extrait sec en poudre de Fenugrec, Extrait sec en poudre de Guggul.', 'Utilisable dans un bain, ou même mélangé à de l\'eau en application cutanée, ou encore en complément alimentaire dans un jus de fruis.\r\nComposition : Extrait sec en poudre de Brahmi, Extrait sec en poudre de Centella Indiana, Extrait sec en poudre de Amalaki.', 2, 'https://media.cdnws.com/_i/48378/4038/3772/38/melange-quatre-epices.jpeg.webp', 1),
(154, 8, 4, 'Long Xie Wan', 'La médecine traditionnelle chinoise est issue d\'une longue tradition et D.Y.MED a pu assimiler ces connaissances anciennes\r\net utiliser des méthodes avancées et technologies les plus modernes afin que l\'essence des plantes médicinales qui composent nos pillules Long Xie soit la plus pure et naturelle.\r\nCes pillules sont réalisées grace à une technique de décoction très lente, permettant de conserver les prioriétés médicinales des plantes.\r\nComplément alimentaire à base de plantes. Pilules à libération prolongée et à haute absorption.', 'Détoxifiant (Foie/Rate), Régénérant cellulaire leger, Calmant.', 'Extrait sec de Rhehmannia, extrait sec de Poria, extrait sec d\'Alisma, extrait sec de réglisse chinoise, extrait sec d\'angélique chinoise,\r\nextrait sec de Bupleurum, extrait sec de Scutellaria, extrait sec de Gardenia, extrait sec de Gentiana, extrait sec de Gentiana Platane mineur.', '', 103, 'https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQpeOHz8nps0xz3lUw5wWojdBEoBFbwekEWlA&usqp=CAU', NULL),
(155, 8, 4, 'Xiao Yao Wan', 'La médecine traditionnelle chinoise est issue d\'une longue tradition et D.Y.MED a pu assimiler ces connaissances anciennes\r\net utiliser des méthodes avancées et technologies les plus modernes afin que l\'essence des plantes médicinales qui composent nos pillules Xiao Yao soit la plus pure et naturelle.\r\nCes pillules sont réalisées grace à une technique de décoction très lente, permettant de conserver les prioriétés médicinales des plantes.\r\nComplément alimentaire à base de plantes. Pilules à libération prolongée et à haute absorption.', 'Anti-migraine, Donneur d\'appetit, Calme les douleurs menstruelles.', 'Bai Shao (Radix Albus Paeoniae Lactiflorae), Bo He (Herba Menthae Haplocalyx), Chai Hu (Radix Bupleuri), Chao Bai Zhu (Rhizoma Atractylodis Macrocephalae praeparata), \r\nDang Gui (Radix Angelicae sinensis), Sclerotum Poriae Cocos (Fu Ling), Sheng Jiang (Rhizoma Zingineris Officinalis Recens), Zhi Gan Cao (Radix Glycyrrhizae Uralensis praeparata)', NULL, 3, 'https://larivieremeunier.com/wp-content/uploads/2016/06/SKU-JIA-WEI-XIAO_5174.jpg', NULL),
(156, 8, 4, 'Tube d\'armoise séchée (Moxibustion)', 'Son utilisation permet de chauffer les points d\'acupuncture et diriger la circulation du Qi à l\'intérieur des méridiens,\r\nde façon à obtenir de meilleurs résultats thérapeutiques.\r\nL\'usage du Moxa fait partie des plus anciennes formes thérapeutiques de la Médecine Traditionnelle Chinoise.\r\nL’énergie vitale bloquée peut de nouveau être libérée par l’action de la chaleur produite par la combustion de l\'armoise, au dessus de certains points d’acupuncture spécifiques.\r\nLa pratique de la moxibustion à pour objectif de repousser le froid et libérer l’humidité dans les méridiens. D’après la conception occidentale,\r\nle traitement par la chaleur contribue à améliorer l’irrigation sanguine des tissus, à stimuler les fonctions organiques et à renforcer les défenses immunitaires.', 'Anti-migraine, Donneur d\'appetit, Calme les douleurs menstruelles.', 'AI YE - Folium Artemisiae Argyi, GUI ZHI - Ramulus Cinnamomi, HUO XIANG - Herba Pogostemonis, CANG ZHU - Rhizoma Actractylodis, DAN SHEN - Radix Salviae Miltiorrhizae, \r\nBAI ZHI - Radix Angelicae Dahuricae, XIANG FU - Rhizoma Cyperi, JIANG XIANG - Ligni Dalbergiae Odoriferae, QIANG HUO - Rhizoma & Radix Notopterygii', NULL, 2, 'https://www.planetaverd.net/media/catalog/product/cache/1/small_image/280x/9df78eab33525d08d6e5fb8d27136e95/j/5/j501_.jpg', NULL);
INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(157, 9, 4, 'Huile de Corps de Marula', 'Garantie sans paraben, pure, pour conserver intactes toutes les propriétés prouvées du Marula, cette huile peut être\r\nutilisée à la fois sur le visage, le corps et mélangée à d’autres soins cosmétiques (lait, gommage, masque, crème) pour plus de douceur,\r\nde souplesse et d\'efficacité.\r\nRapidement absorbée par la peau, elle l’hydrate, détend et la préserve. L’un de ses atouts est\r\nnotamment sa très longue durée de conservation (plus de 2 ans, sans additifs).', 'Réparatrice, adoucissante, riche en acides mono-insaturés et antioxydants', '100% Huile de Marula.', NULL, 2, 'data:image/jpeg;base64,', NULL),
(158, 9, 4, 'Huile de Dattier du Désert', 'L’huile végétale de Dattier du Désert Najel extraite d’une unique pression à froid des graines du dattier est un puissant émollient.\r\nElle assouplit et répare les peaux sèches et abîmées.\r\nCette huile végétale au toucher très sec est idéale pour le soin des peaux mixtes, elle protège la peau sans la surgraisser.\r\nL’huile de Dattier du Désert est également recommandée pour le soin des cheveux. Elle répare et redonne de la souplesse aux cheveux secs et abîmés.', 'Réparatrice, Hydratante, Soin capillaire.', '100% Huile de graine de Dattier du Désert.', NULL, 2, 'data:image/jpeg;base64,', NULL);
INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(159, 9, 4, 'Résine de Copaiba', 'La résine de copaïba est un cicatrisant puissant à la fois antiseptique et anti-inflammatoire, il aide à la cicatrisation des plaies les plus difficiles.\r\nLe copaïba est très efficace sur les douleurs articulaires, rhumatismes, entorses, les hématomes, les tendinites.\r\nEn usage externe, en massage. Pour les peaux sensibles, mélanger avec de l\'huile d\'amande douce.', 'Aisance articulaire, anti-inflammatoire, reposant musculaire.', '100% Résine de Copaiba pure.', NULL, 2, 'data:image/png;base64,', NULL);
INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(160, 10, 4, 'Baume Précieux D.Y.Soin', 'Le baume précieux D.Y.Soin hydrate et nourrit la peau, le visage et les cheveux. Synergie du beurre de karité,\r\ndes huiles vierges de nigelle (ou cumin noir), d\'Inophyllum calophyllum et de l\'huile essentielle de Géranium rosat.\r\nTous ses composants sont issus de l\'agriculture biologique (99,8%) et éthique. Les matières premières qui composent le baume précieux D.Y.Soin\r\nsont issues de coopératives ou de groupement de paysans maintenant une économie locale offrant ainsi une ressource...', 'Réparateur, Adoucissant, Hydratant', 'Beurre naturel de Karité, Huile naturelle de Nigelle et Cumin Noir, Poudre Inophyllum Calyphyllum, Huile essentielle de Géranium Rosat.', NULL, 3, 'data:image/jpeg;base64,', NULL);
INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(161, 10, 4, 'Onguent aux 7 plantes', 'Usage particulièrement économique car il en faut peu à chaque utilisation.\r\n7 plantes : arnica, laurier, consoude gaulthérie, eucalyptus citronné, romarin, menthe poivrée .\r\nCes plantes sont réputées pour leurs actions bénéfiques sur les articulations et les tendons.\r\nEn application sur les zones sensibles, cet onguent contribuera à apaiser les zones d’inconfort.\r\nParticulièrement recommandé avant et après un exercice physique. Un baume à intégrer dans sa routine sportive !', 'Réparateur, Adoucissant, Hydratant', 'Huile d\'arnica, Huile de laurier, Huile à la consoude, Cire d\'abeille (cire d\'opercule), Huile essentielle de gaulthérie (1%), Huile essentielle d\'eucalyptus citronné (1%), Huile essentielle de romarin (1%), Huile essentielle de menthe poivrée (1%)', NULL, 4, 'data:image/jpeg;base64,', NULL);
INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(162, 11, 4, 'Huile essentielle de Menthe poivree.', 'Cette huile stimule et revigore corps et esprit, et est traditionnellement connue pour aider à lutter contre les nausées,\r\nle mal des transports et les maux de tête. Réfrigérante, elle s\'utilise aussi pour soulager les rougeurs.', 'Anti-Inflammatoire, Assainir l\'air, Regulateur de tension', 'menthol (37.49%), 1,8-cinéole (5.47%); menthofuran (1.96%); menthone (27.52%); pulégone (1.09%); Esters terpéniques -> acétate de menthyle (5.62%)', NULL, 1, 'data:image/jpeg;base64,', NULL);
INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(163, 11, 4, 'Huile essentielle d\'Amande Ecorce.', 'L\'écorce épaisse, rugueuse et parfumée, du cannelier est riche d\'une huile essentielle très forte et concentrée, que l\'on surnomme \"l\'Attila des huiles essentielles\".\r\nSon parfum est celui qu\'on recherche lorsqu\'on utilise la cannelle comme épice - chaud et suave et gourmands.', 'Anti-Inflammatoire, Assainir l\'air, Aide à la relaxation, Nourrissante.', 'E-Cinnamaldéhyde (55.0% à 76.0%), Eugénol (2.0 à 13.5%)', NULL, 1, 'data:image/jpeg;base64,', NULL);
INSERT INTO `articles` (`id`, `categories_id`, `producteurs_id`, `titre`, `description`, `proprietes`, `compo`, `utilisation`, `vues`, `photo`, `devant`) VALUES
(164, 11, 4, 'Huile essentielle d\'Ecalyptus Citronné.', 'L’eucalyptus citronné est un peu « à part » dans la famille des eucalyptus, car il ne contient pas d’eucalyptol.\r\nSon parfum diffère aussi : comme son nom l’indique, il sent le citron !\r\nNous avons choisi l’huile essentielle d’eucalyptus citronné de Madagascar - où il s’est parfaitement acclimaté – pour sa qualité exceptionnelle.', 'Anti-Inflammatoire, Assainie l\'air', 'Citronellal (70.0% à 83.0%), Eugénol (2.0 à 13.5%)', NULL, 1, 'data:image/jpeg;base64,', NULL);

